sources.styles/blocks/page.scss:
.page {
  &__body {
    background-color: $c-gray;
    box-sizing: border-box;
    margin: 0;
    font-family: "Inter", sans-serif;
    font-weight: 400;
    font-style: normal;
    position: relative;
    scroll-behavior: smooth;

    &--with-menu {
      overflow: hidden;
    }
  }

  &__header {
    max-width: 1440px;
    margin: 0 auto;
  }

  &__welcome {
    margin-bottom: 64px;
  }

  &__we-bake {
    @include onTablet {
      margin-bottom: 98px;
    }

    @include onDesktop {
      margin-bottom: 124px;
    }
  }
}

sources.styles/utils/_mixins.scss:
@mixin hover($_property, $_toValue) {
  transition: #{$_property} 0.3s;
  &:hover {
    #{$_property}: $_toValue;
  }
}

@mixin onMobile {
  @media (min-width: 1px) {
    @content;
  }
}

@mixin onTablet {
  @media (min-width: 640px) {
    @content;
  }
}
@mixin onDesktop {
  @media (min-width: 1024px) {
    @content;
  }
}

@mixin onFullHD {
  @media (min-width: 1200px) {
    @content;
  }
}

