sources.styles/blocks/icon.scss:
.icon {
  width: 20px;
  height: 20px;
  background-position: center;
  background-repeat: no-repeat;
  background-size: contain;

  &--menu {
    background-image: url(../images/menu_mobile.svg);
    &:hover {
      animation: menuRotate 2s linear infinite;
    }
  }

  &--cross {
    background-image: url(../images/menu_cross.svg);
  }

  @include onDesktop {
    display: none;
  }
}

@keyframes menuRotate {
  from {
    transform: rotate(0);
  }
  to {
    transform: rotate(360deg);
  }
}

sources.styles/blocks/hero.scss:
.hero {
  padding: 0 0 40px;

  @include onTablet {
    display: grid;
    grid-template-columns: repeat(8, 1fr);
    gap: 24px;
    padding: 0 0 200px;
  }
  @include onDesktop {
    padding: 0 0 240px;
  }

  @include onFullHD {
    padding: 0 0 220px;
  }

  &__about {
    color: #1c1a26;
    font-size: 16px;
    text-align: center;
    line-height: 150%;
    letter-spacing: -0.01em;
    padding: 32px 0;

    @include onTablet {
      grid-column: 1 / 5;
      text-align: left;
    }

    @include onDesktop {
      grid-column: 1 / 3;
      grid-row: 2 / 3;
      align-self: flex-end;
      padding: 0;
    }
  }

  &__moto {
    font-size: 64px;
    font-weight: 400;
    line-height: 85%;
    text-align: center;
    letter-spacing: -0.05em;
    text-transform: uppercase;
    color: #1c1a26;

    animation: text 1.5s ease 0.1s;

    @include onTablet {
      font-size: 80px;
      font-weight: 400;
      grid-column: 1 / 9;
      grid-row: 2 / 3;
      align-self: center;
    }

    @include onDesktop {
      font-size: 136px;
      grid-row: 3 / 6;
    }

    @include onFullHD {
      font-size: 144px;
    }
  }

  &__img {
    width: 100%;

    animation: cookieAnimation 2s linear, cookieRotate 1s linear 1s;

    @include onTablet {
      grid-column: 3 / 7;
      grid-row: 2 / 3;
      z-index: -1;
    }
    @include onDesktop {
      grid-row: 1 / 8;
      z-index: -1;
    }
  }

  &__button {
    @include onTablet {
      grid-column: 3 / 7;
    }
    @include onDesktop {
      grid-column: 1 / 3;
      grid-row: 6 / 7;
      margin-top: 60px;
    }
  }
}

@keyframes text {
  0% {
    transform: translateX(-200%);
    color: #f00;
  }
  50% {
    transform: translateX(50%);
    color: #ff0;
  }
  90% {
    transform: translateX(-20%);
    color: #fffff0;
  }
  100% {
    transform: translateX(0);
    color: #1c1a26;
  }
}

@keyframes cookieAnimation {
  0% {
    // width: 0;
    transform: translateY(-200%);

  }
  50% {
    // width: 120%;
    transform: translateY(10%);

  }
  100% {
    transform: translateY(0);
    // width: 100%;
  }
}

@keyframes cookieRotate {
  0% {
    transform: rotate(360deg);
  }

  50% {
    transform: rotate(-360deg);
  }
  100% {
    transform: rotate(360deg);
  }
}

sources.styles/blocks/menu.scss:
.menu {
  position: fixed;
  background-color: #eef7ff;
  height: 100vh;
  left: 0;
  right: 0;
  top: 0;
  transform: translateX(-100%);

  &:target {
    transform: translateX(0);
  }

  &__list {
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
  }
}

sources.styles/blocks/list.scss:
.list {

  @include onMobile {
    display: none;
  }

  @include onDesktop {
    display: flex;
  }

  margin: 0;
  padding: 0;
  list-style-type: none;

  &--menu {
    display: grid;
    grid-template-columns: 1fr;
    justify-content: center;
    align-items: center;
    gap: 24px;
  }
  &__link {
    display: block;
    text-decoration: none;
    margin-left: 64px;
    text-align: center;
    font-size: 16px;
    line-height: 150%;
    letter-spacing: -0.01em;
    color: #1c1a26;

    transition: font-weight 0.3s linear, scale 0.3s linear;

    &:hover {
      font-weight: 800;
      transform: scale(1.04);
    }

    &--menu {
      margin-left: 0;
    }

    &--last {
      color: #f9512e;
      height: 100%;
      display: flex;
      justify-content: center;
      align-items: center;
      letter-spacing: 0.02em;
      text-transform: uppercase;
      font-weight: 500;
      line-height: 100%;

      &::before {
        content: "";
        display: block;
        width: 18px;
        height: 18px;
        margin-right: 6px;
        background-image: url(../images/red_phone.png);
        background-repeat: no-repeat;
        background-position: center;
        background-size: cover;
      }
    }
  }
}

sources.styles/blocks/button.scss:
.button {
  height: 56px;
  box-sizing: border-box;
  display: flex;
  justify-content: center;
  align-items: center;
  width: 100%;
  border: 2px solid #f9512e;
  border-radius: 32px;

  font-weight: 500;
  font-size: 16px;
  line-height: 100%;
  color: #f9512e;
  letter-spacing: 0.02em;
  text-transform: uppercase;
  text-decoration: none;

  &::before {
    content: "";
    display: block;
    width: 20px;
    height: 20px;
    margin-right: 6px;
    background-image: url(../images/button_cookie_norm.svg);
  }

  &:hover {
    background-color: #f9512e;
    color: #fff;

    &::before {
      content: "";
      display: block;
      width: 20px;
      height: 20px;
      margin-right: 6px;
      background-image: url(../images/button_cookie_hover.svg);
    }
  }

  &:focus {
    background-color: #b3341a;
    color: #fff;
    border-color: #b3341a;

    &::before {
      content: "";
      display: block;
      width: 20px;
      height: 20px;
      margin-right: 6px;
      background-image: url(../images/button_cookie_hover.svg);
    }
  }
}

