sources.styles/blocks/grid.scss:
.grid {
  justify-content: center;

  @include onMobile {
    justify-content: start;
    gap: 40px;
  }
  @include onTablet {
    display: grid;
    grid-template-columns: repeat(2, 1fr);
    gap: 24px;
  }
  @include onDesktop {
    grid-template-columns: repeat(8, 1fr);
  }

  @include onFullHD {
    grid-template-columns: repeat(8, 128px);
  }

  @for $start from 1 through 8 {
    @for $end from $start through 8 {

      &--#{$start}-#{$end} {
        display: block;
        @include onDesktop {
          grid-column: #{$start} / #{$end + 1};
        }
      }
    }
  }
}

sources.styles/blocks/sweets.scss:
.sweets {

  &__photo {
    margin-bottom: 16px;

    // &:hover {

    // }
  }
  &__img {
    width: 100%;
    border-radius: 8px;
    transition: transform 0.2s;

    &:hover {
      transform: scale(1.05);
      animation: imgBorder 2s linear 0.2s infinite;
    }
  }

  &__category {
    display: block;
    font-size: 16px;
    font-weight: 500;
    line-height: 100%;
    letter-spacing: 0.02em;
    text-transform: uppercase;
    color: #7f8096;
    text-decoration: none;
    margin-bottom: 8px;
    transition: color 0.3s linear;

    &:hover {
      color: #f9512e;
    }
  }

  &__about {
    font-size: 16px;
    line-height: 150%;
    letter-spacing: -0.01em;
    color: #1c1a26;
    margin-bottom: 24px;
  }

  &__order {
    font-weight: 500;
    font-size: 16px;
    line-height: 100%;
    letter-spacing: 0.02em;
    text-transform: uppercase;
    color: #f9512e;
    display: flex;
    width: max-content;
    text-decoration: none;
    margin-bottom: 8px;

    transition: font-weight 0.3s linear;

    &:hover {
      font-weight: bold;
      text-decoration: underline;
    }

    &::before {
      content: "";
      display: inline-block;
      width: 16px;
      height: 16px;
      margin-right: 8px;
      background-image: url(../images/before_arrow.svg);
      background-position: center;
      background-repeat: no-repeat;
      background-size: contain;
    }
  }
}
@keyframes imgBorder {
  0% {
    box-shadow: 1px 1px 1px rgb(237, 88, 237);
    z-index: 2;
  }

  60% {
    z-index: 2;
    box-shadow: 4px 3px 5px rgb(234, 106, 212),
      -4px 3px 5px rgb(106, 234, 183),
      -4px -3px 5px rgb(35, 211, 227);
  }

  100% {
    box-shadow: 1px 1px 1px rgb(250, 0, 167);
    z-index: 2;

  }
}

sources.styles/blocks/about.scss:
.about {
  position: relative;
  padding-bottom: 70px;

  @include onTablet {
    padding-bottom: 150px;
  }

  @include onDesktop {
    padding-bottom: 350px;
  }

  &__back-ground {
    background-image: url(../images/Crumbs.png);
    background-repeat: no-repeat;
    background-position: center;
    background-size: contain;

    position: absolute;
    min-width: 320px;
    min-height: 300px;
    left: -16px;
    right: -16px;
    bottom: 250px;
    z-index: -1;

    @include onTablet {
      height: 490px;
      width: 520px;
      left: 50%;
      top: 0;
      transform: translateX(-50%);
    }

    @include onDesktop {
      width: 720px;
      height: 680px;
      bottom: 56px;
      right: 113px;
    }
  }

  &__title {
    margin-bottom: 32px;
  }

  &__text {
    margin-bottom: 64px;
  }

  &__about-us {
    display: block;
    @include onTablet {
      display: grid;
      gap: 24px;
      grid-template-columns: repeat(2, 1fr);
    }
  }

  &__pross {
    display: grid;
    gap: 48px;

    @include onTablet {
      grid-template-columns: repeat(2, 1fr);
      gap: 80px 24px;
    }

    @include onDesktop {
      grid-template-columns: repeat(4, 1fr);
    }
  }

  &__value {
    font-weight: 400;
    font-size: 96px;
    line-height: 85%;
    letter-spacing: -0.05em;
    text-transform: uppercase;
    color: #1c1a26;

    margin-bottom: 8px;
  }

  &__name-value {
    font-size: 16px;
    line-height: 150%;
    letter-spacing: -0.01em;
    color: #7f8096;
  }
}

sources.styles/blocks/footer.scss:
.footer {

  background-color: #1c1a26;

  &__container {
    display: grid;
    padding: 56px 0;

    @include onTablet {
      padding: 88px 0;
    }
  }

  &__nav:first-child {
    margin-bottom: 64px;
  }
  &__logo {
    margin-bottom: 44px;

    @include onTablet {
      margin-bottom: 108px;
    }
  }

  &__sub-title {
    font-size: 16px;
    font-weight: 500;
    line-height: 100%;
    letter-spacing: 0.02em;
    text-transform: uppercase;
    color: #7f8096;
  }

  &__link {
    color: #fff;
    text-decoration: none;
    display: inline-block;

    &::after {
      content: "";
      display: block;
      height: 1px;
      width: 0;
      background-color: #fff;
    }

    &:hover::after {
      animation: lineAfter 0.3s linear;

      width: 100%;
    }
  }

  &__menu-list {
    display: grid;
    gap: 16px;

    &--call {
      margin-bottom: 40px;
      @include onDesktop {
        margin-bottom: 0;
      }
    }

    &--email {
      @include onDesktop {
        display: flex;
        flex-direction: column;
      }
    }
  }

  &__contact-us {
    font-size: 48px;
    font-weight: 400;
    line-height: 85%;
    letter-spacing: -0.05em;
    text-transform: uppercase;
    color: #fff;
    padding: 3px;
    margin-bottom: 40px;

    @include onTablet {
      font-size: 56px;
      max-width: 330px;
    }
  }

  &__social {
    display: inline-block;

    &:nth-child(2) {
      margin: 0 35px;
    }
  }

  &__social:hover > svg > .svg {
    fill: #fff;
  }

  &__all-rights {
    font-size: 16px;
    line-height: 150%;
    letter-spacing: -0.01em;
    color: #7f8096;
  }

  &__communication {

    @include onDesktop {
      display: grid;
      grid-template-columns: repeat(2, 1fr);
    }
  }
}

@keyframes lineAfter {
  from {
    width: 0;
  }
  to {
    width: 100%;
  }
}
